// Pets.jsx
import React from 'react';
import './Pet.css';
import { useNavigate } from 'react-router-dom';
const Pets = () => {
	const navigate = useNavigate();

	const handleReadMoreClick = () => {
	  navigate('/Adopt');
	};
  return (
    <div class="container5">
  <div class="card-deck">
    <div class="card">
      <img class="card-img-top" src="data:image/webp;base64," alt="Card image cap"/>
      <div class="card-body">
        <h5 class="card-title">Golden Retriever</h5>
        <p class="card-text">Life span
		10 – 12 years</p>
		<br/><button onClick={handleReadMoreClick}>ADOPT</button>
      </div>
    </div>
    <div class="card">
      <img class="card-img-top" src="data:image/webp;base64," alt="Card image cap"/>
      <div class="card-body">
        <h5 class="card-title">French Bulldog</h5>
        <p class="card-text">Life span
		
		10 – 12 years
		</p>
		<br/><button>ADOPT</button>
      </div>
    </div>
    <div class="card">
      <img class="card-img-top" src="data:image/webp;base64," alt="Card image cap"/>
      <div class="card-body">
        <h5 class="card-title">Alaskan Malamute</h5>
        <p class="card-text">Life span
		
		10 – 12 years</p>
		<br/><button>ADOPT</button>
      </div>
    </div>
    <div class="card">
      <img class="card-img-top" src="data:image/webp;base64," alt="Card image cap"/>
      <div class="card-body">
        <h5 class="card-title">Bichon Frisé</h5>
		<p class="card-text">Life Span
			10 – 14 years</p>

      <br/><button>ADOPT</button>
      </div>
    </div>
  </div>
</div>
  );
}

export default Pets;